import { createSlice } from '@reduxjs/toolkit/dist/createSlice';

const initialState = {
  accessToken: '',
  refreshToken: '',
};

export const loginSlice = createSlice({
  name: 'login',
  initialState: initialState,
  reducers: {
    changeAcToken: (state) => {
        state.accessToke
    }
  },
});

export const {} = loginSlice.actions;

export default loginSlice.reducer;
